import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';


import PSPE_Logo from '../../images/PSPE_logo.png';
import './style.navbar.css';



export class Navbar extends Component {
	render() {
		return(
            <div className="navbar">
                <div className="logoContainer">
                    <Link to="/"><img className="logoImage" src={PSPE_Logo}/></Link>
                </div>
                <div className="navlinkCollection">
                    <Link className="navlink" to="/">Home</Link>
                    <Link className="navlink" to="/about">About</Link>
                    <Nav>
                    <NavDropdown title="Events" id="collasible-nav-dropdown">
                        <Link className="navlink" to="/events"><NavDropdown.Item href="#action/3.1">Event 1</NavDropdown.Item></Link>
                        <Link className="navlink" to="/events"><NavDropdown.Item href="#action/3.2">Event 2</NavDropdown.Item></Link>
                        <Link className="navlink" to="/events"><NavDropdown.Item href="#action/3.3">Event 3</NavDropdown.Item></Link>
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                    </NavDropdown>
                    </Nav>

                    <Link className="navlink" to="/news">News</Link>
                    <Link className="navlink" to="/contact">Contact</Link>
                    <Link className="navlink" to="/sponsors">Sponsors</Link>
                </div>


            </div>
        );
	}
}

export default Navbar;
